            acronym: 'DEE83',
            description:
              'A form of epileptic encephalopathy, a heterogeneous group of severe early-onset epilepsies characterized by refractory seizures, neurodevelopmental impairment, and poor prognosis. Development is normal prior to seizure onset, after which cognitive and motor delays become apparent. DEE83 is an autosomal recessive form characterized by onset of frequent, intractable seizures in the first days to months of life. Affected individuals have profound developmental delay with no motor or language skill acquisition, and poor or absent visual tracking. Many patients die in the first years of life.',
